public int active()
{
    int                          ret;
    SC_AddressCountryRegionSetup addressCountryRegionSetup;
    RecordInsertList             addressCountryRegionSetupList = new RecordInsertList(tableNum(SC_AddressCountryRegionSetup));
    ;

    ret = super();

    if(SC_WebShopsTable.WebShopId)
    {
        while select LogisticsAddressCountryRegion
            notexists join addressCountryRegionSetup
            where LogisticsAddressCountryRegion.CountryRegionId == addressCountryRegionSetup.CountryRegionId &&
                  addressCountryRegionSetup.WebShopId == SC_WebShopsTable.WebShopId                      
        {
            addressCountryRegionSetup.CountryRegionId = LogisticsAddressCountryRegion.CountryRegionId;
            addressCountryRegionSetup.WebShopId = SC_WebShopsTable.WebShopId;
            addressCountryRegionSetupList.add(addressCountryRegionSetup);
        }

        addressCountryRegionSetupList.insertDatabase();
    }

    if(SC_WebShopsTable.EnableB2BCustTemplate)
    {
        SC_AddressCountryRegionSetup_B2BTemplateCustomer.visible(true);
        TemplateAccount.label("@SCL638");
    }
    else
    {
        SC_AddressCountryRegionSetup_B2BTemplateCustomer.visible(false);
        TemplateAccount.label("@SCL63");
    }

    SysQuery::findOrCreateRange(SC_AddressCountryRegionSetup_ds.query().dataSourceTable(tableNum(SC_AddressCountryRegionSetup)), fieldNum(SC_AddressCountryRegionSetup, WebshopId)).value(SC_WebShopsTable.WebShopId);
    LogisticsAddressCountryRegion_ds.executeQuery();

    SysQuery::findOrCreateRange(SC_ItemVisibilityRules_ds.query().dataSourceTable(tableNum(SC_ItemVisibilityRulesTable)), fieldNum(SC_ItemVisibilityRulesTable, WebshopId)).value(SC_WebShopsTable.WebShopId);
    SC_ItemVisibilityRules_ds.executeQuery();            

    return ret;
}

